import React from 'react';
import ClassCard from '../components/shared/ClassCard/ClassCard';

const GroupPage = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Group Page</h1>
      <div style={{ display: 'flex', gap: '20px' }}>
        <ClassCard />
        <ClassCard />
      </div>
    </div>
  );
};

export default GroupPage;
